import React from "react";
import {
    Nav,
  NavItem,
  NavLink,
} from "react-router-dom";

import Home from './Home';

export default function Navbar() {
    return (

        <div>
            <ul>
                <li>
                    <Link to="/">Home</Link>
                </li>
                <li>
                    <Link to="/about">About</Link>
                </li>
                <li>
                    <Link to="/dashboard">Dashboard</Link>
                </li>
            </ul>

        </div>

    );
}
